import React from "react";
import './Header.css'

export default function Header() {
    return (
        <div className='Header'>
            <div className='line'>
            </div>
            <div className='parrafo'>             
                    A través de una intensa búsqueda de colores e ideas que buscan cambiar los esquemas personales de los espectadores de su obra, Rafael Merino Orea, quien cuenta con 48 años de trayectoria artística, se ha convertido en uno de los pintores más prestigiados de nuestro país gracias a la perfecta definición del cuerpo humano plasmada en sus lienzos.
            </div>
        </div>
    );
}
